MongoDB query to find most recently added object in an array within a document then making a further query based on that result<p>I have two collections in MongoDB; users &amp; challenges.</p>
<p>The structure of the users collection looks like this:</p>
<pre><code>name: &quot;John Doe&quot;
email: &quot;john@doe.com&quot;
progress: [
        {
         _id : ObjectId(&quot;610be25ae20ce4872b814b24&quot;)
         challenge: ObjectId(&quot;60f9629edd16a8943d2cab9b&quot;)
         completed: true
         date_completed: 2021-08-06T12:15:32.129+00:00
        }
        {
         _id : ObjectId(&quot;611be24ae32ce4772b814b32&quot;)
         challenge: ObjectId(&quot;60g6723efd44a6941l2cab81&quot;)
         completed: true
         date_completed: 2021-08-07T12:15:32.129+00:00
        }
]
date: 2021-08-05T13:06:34.129+00:00
</code></pre>
<p>The structure of the challenges collection looks like this:</p>
<pre><code>_id: ObjectId(&quot;610be25ae20ce4872b814b24&quot;)
section_no: 1
section_name: &quot;Print Statements&quot;
challenge_no: 1
challenge_name: &quot;Hello World!&quot;
default_code: &quot;public class Main {public static void main(String[] args) {}}&quot;
solution: &quot;Hello World!&quot;
</code></pre>
<p>What I want to be able to do is find the most recent entry in a particular user's 'progress' array within the users collection and based on that result I want to query the challenges collection to find the next challenge for that user.</p>
<p>So say the most recent challenge entry in that user's 'progress' array is...</p>
<pre><code>        {
         _id : ObjectId(&quot;611be24ae32ce4772b814b32&quot;)
         challenge: ObjectId(&quot;60g6723efd44a6941l2cab81&quot;)
         completed: true
         date_completed: 2021-08-07T12:15:32.129+00:00
        }
</code></pre>
<p>...which is Section 1 Challenge 2. I want to be able to query the challenges collection to return Section 1 Challenge 3, and if that doesn't exist then return Section 2 Challenge 1.</p>
<p>Apologies if this is worded poorly, I am fairly new to MongoDb and unsure of how to create complex queries in it.</p>
<p>Thanks in advance!</p>

