How can I update a document's nested array of object item by 1?<p>I'm trying to update a mongoose document with the help of <code>findOneAndUpdate</code> but I'm unable to do so. The document looks like this in the database:</p>
<pre><code>{
    'docId': 1001,
    'totalViews': 3,
    'docInfo': [
         {
             id: 1,
             views: 2  
         },
         {
             id: 2,
             views: 1  
         }
    ]
}
</code></pre>
<p>I'm trying to update <code>totalViews</code> by 1 which will make the total count to be 4. And I also need to update the second object's <code>views</code> property by 1 in <code>imageInfo</code> array. Which will have a views count of 2.</p>
<p>I tried doing this by first fetching the whole document with the help of:</p>
<pre><code>const doc = await Doc.find({ docId: 1001 });
</code></pre>
<p>Then found the index of the <code>docInfo</code> array item which needs to be updated. Which is the object with id 2.</p>
<pre><code>const docIndex = doc[0].docInfo.findIndex( item =&gt; {
      return item.id === 2;
});
</code></pre>
<p>Then used <code>findOneAndUpdate</code> to update the items:</p>
<pre><code>await Doc.findOneAndUpdate(
      { docId: 1001, &quot;docInfo.id&quot;: 2 },
      {
            $set: {
                  [ `docInfo.${2}.views` ]: 1++,
                  'totalViews': 1++ 
            }
      }, { new: true }
);

</code></pre>
<p>With this I'm getting this error:</p>
<pre><code>SyntaxError: Invalid left-hand side expression in postfix operation
</code></pre>
<p>What am I doing wrong here?</p>

