Retrieving the last 40 or some specific number of elements from array in MongodB<p>I'm building a messenger app using React.js with Node.js in the backend as an API, Express.js, MongodB and Socket.io. I want to send only the recent 40 or some specific number of messages to the user on initial load and send the rest later when the user requests.</p>
<p>Here's the DM(Direct Message) Model:</p>
<pre><code>const dmSchema = new Schema(
    {
        users: [
            {
                type: mongoose.Schema.Types.ObjectId,
                ref: 'User'
            }
        ],
        messages: [
            {
                message: String,
                from: {
                    type: mongoose.Schema.Types.ObjectId,
                    ref: 'User'
                },
                recipient: {
                    type: mongoose.Schema.Types.ObjectId,
                    ref: 'User'
                },
                timestamp: {
                    type: Date,
                    default: Date.now
                }
            }
        ],
        lastSeenMessage: [
            {
                by: {
                    type: mongoose.Schema.Types.ObjectId,
                    ref: 'User'
                },
                messageId: String
            }
        ]
    }
);
</code></pre>
<p>How can I set a limit for the messages array in the mongoose find method, and I would also like to get some ideas on keeping track of the messages sent already and decide what messages to send next.</p>
<p>Thank You :)</p>

