Trying to connect to MongoDB using Realm<p>It's the first time I use Realm and MongoDB.
I followed this <a href="https://blog.shahednasser.com/how-to-integrate-mongo-realm-with-react-part-1/" rel="nofollow noreferrer">good tutorial</a> as starting point and I create this project.</p>
<p><a href="https://codesandbox.io/s/realm-forked-mrjex?file=/src/state/DbModel.ts" rel="nofollow noreferrer">https://codesandbox.io/s/realm-forked-mrjex?file=/src/state/DbModel.ts</a></p>
<p>The folder structure is:</p>
<pre class="lang-js prettyprint-override"><code>src
|_ components
   |_ pages
      |_ Authentication.tsx
      |_ Home.tsx
      |_ Logout.tsx
   |_ App.tsx
   |_ Navigation.tsx
   |_ RestaurantCard.tsx
|_ lib
   |_ db-utils.ts
|_ state
   |_ index.ts
   |_ DbModel.ts
</code></pre>
<p>They are all very easy components, I post here only some pieces of them.</p>
<p>App.tsx:</p>
<pre><code>const serviceName = &quot;mongodb-atlas&quot;;

export function App() {
  return (
    &lt;Provider value={stateInstance}&gt;
      &lt;AppWithState /&gt;
    &lt;/Provider&gt;
  );
}

function AppWithState() {
  const {
    db: { app, client, setClient, user, setUser }
  } = useMst();

  useEffect(() =&gt; {
    async function init() {
      if (!user) {
        const credentials = Realm.Credentials.anonymous();
        const newUser = app.currentUser
          ? app.currentUser
          : await app.logIn(credentials);
        setUser(newUser);
      }
      if (!client) {
        const newClient = app.currentUser.mongoClient(serviceName);
        setClient(newClient);
      }
    }
    init();
  }, [app, client, user]);

  return (
    &lt;Router&gt;
      &lt;Navigation /&gt;
      &lt;Switch&gt;
        &lt;Route path=&quot;/&quot; component={Home} /&gt;
        ...
      &lt;/Switch&gt;
    &lt;/Router&gt;
  );
}
</code></pre>
<p>state/index.ts:</p>
<pre><code>export const StateModel = t
  .model(&quot;StateModel&quot;, {
    db: t.optional(DbModel, {} as DbModelInstance)
  })
  .views((self) =&gt; ({}))
  .actions((self) =&gt; ({}));

export const stateInstance = StateModel.create();
export interface StateInstance extends Instance&lt;typeof StateModel&gt; {}

const RootStateContext = createContext&lt;StateInstance | null&gt;(null);
export const Provider = RootStateContext.Provider;

export function useMst() {
  const state = useContext(RootStateContext);
  if (state === null)
    throw new Error(&quot;State cannot be null, please add a context provider&quot;);
  return state;
}
</code></pre>
<p>state/DbModel.ts:</p>
<pre><code>const appId = process.env.REACT_APP_REALM_APP_ID;
const appConfig: Realm.AppConfiguration = {
  id: appId
};
const app: Realm.App = new Realm.App(appConfig);

